    [],nt"revision_timestamp": "2016-05-31T01:07:53.160348",nt"name": "alaska-northern-fur-seal-adult-female-satellite-telemetry-and-oceanographic-data-2002-0-2009-10",nt"isopen":
    false,nt"url": null,nt"notes": "This data set is comprised of data used
    for an analysis of the interactions between adult female northern fur seal migratory
    and foraging behavior and oceanographic conditions published by Pelland et al. (2014),
    with emphasis on individuals that traveled into the California Current Ecosystem.
    Forty-one migratory routes from forty seals (one seal was monitored during two separate
    migrations) spanning seven migratory seasons were obtained between 2002/03 and 2009/10
    . Of those forty seals, eight were equipped with satellite transmitters that also
    recorded and transmitted diving behavior.",nt"license_title": null,nt"extras":
